import React from "react";
import Card from "./Post";

const PostList = ({matchedData}) => {

  return (
      <div className="col-12 p-5 row">
        {matchedData.map((post,ind) => (
         <Card key={ind} postData={post} />
        ))}
      </div>
  );
};

export default PostList;
